import React from 'react';
import TodoListItem from './TodoListItem.js';

const TodoList = ( { todos } ) => {

  const elements = todos.map((item) => {
    let { id, ...itemProps } = item;      // Сделано чтобы не передавать id в TodoListItem
    return (
      <li key = {id}>
        <TodoListItem {...itemProps } />  // то же что и label = { itemProps.label} ... работает так как имена совпадают
      </li>);
  });

  return (
    <ul>
      {elements}
    </ul>
  );
}

export default TodoList;
